            ["onInteract"] = "local Serial = require \"actions/Serial\"\nlocal Do = require \"actions/Do\"\nlocal MessageBox = require \"actions/MessageBox\"\nlocal Animate = require \"actions/Animate\"\nlocal Wait = require \"actions/Wait\"\nlocal Ease = require \"actions/Ease\"\nlocal BlockPlayer = require \"actions/BlockPlayer\"\nlocal PlayAudio = require \"actions/PlayAudio\"\n\nreturn function(self)\n    if GameState:isFlagSet(self:getFlag()) then\n        return Do(function() end)\n    else\n        GameState:setFlag(self:getFlag())\n        GameState:setFlag(\"ep3_sallynap_over\")\n        local prevAnim = scene.player.ToIdle[self.scene.player.sprite.selected]\n        return BlockPlayer {\n            MessageBox {message = \"Sally: Leon?\"},\n            Ease(self.scene.camPos, \"x\", -300, 0.3),\n            PlayAudio(\"music\", \"sonicsad\", 1.0, true, true),\n            MessageBox {message = \"Leon: It's been so long since I've been back here...\"},\n            MessageBox {message = \"Leon: The beauty of nature... {p80}Robotnik hasn't taken it from us yet, has he?\"},\n            Do(function()\n                self.scene.player.noIdle = true\n                self.scene.player.sprite:setAnimation(\"thinking_laugh\")\n            end),\n            MessageBox {message = \"Sally: Not if we have anything to say about it.\"},\n            Wait(1),\n            MessageBox {message = \"Leon: Please excuse the rudeness of my subordinates, Princess.\"},\n            Do(function()\n                self.scene.player.sprite:setAnimation(prevAnim)\n            end),\n            MessageBox {message = \"Leon: These young Mobians have been through a lot...\"},\n            MessageBox {message = \"Sally: More than the rest of us?\"},\n            MessageBox {message = \"Leon: Oh yes...\"},\n            Ease(self.scene.objectLookup.FleetGhost.sprite.color, 4, 75, 1),\n            MessageBox {message = \"Leon: Fleet was a foster child at the time of Robotnik's coup.\"},\n            MessageBox {message = \"Leon: By the time I found her, she had been running from Robotnik's aircrafts and hiding in mountain caves for weeks.\"},\n            Do(function()\n                self.scene.player.sprite:setAnimation(\"sadleft\")\n            end),\n            MessageBox {message = \"Leon: She was all alone. {p60}Sleep deprived{p40}, starving{p40}, mentally and physically exhausted.\"},\n            Ease(self.scene.objectLookup.FleetGhost.sprite.color, 4, 0, 1),\n            Ease(self.scene.objectLookup.LoganGhost.sprite.color, 4, 75, 1),\n            MessageBox {message = \"Leon: As for Logan{p60}, she was left to rot in a prison cell for months, following Robotnik's coup.\"},\n            Do(function()\n                self.scene.player.sprite:setAnimation(\"thinking\")\n            end),\n            MessageBox {message = \"Leon: She was so young at the time, she was low priority for roboticization.\"},\n            MessageBox {message = \"Leon: Before I was able to rescue her, she had already seen every member of her family get roboticized...\"},\n            Ease(self.scene.objectLookup.LoganGhost.sprite.color, 4, 0, 1),\n            Ease(self.scene.objectLookup.IvanGhost.sprite.color, 4, 75, 1),\n            MessageBox {message = \"Leon: And then there's Ivan.\"},\n            MessageBox {message = \"Leon: I came upon Ivan shortly after Robotnik began leveling people's homes in Mobotropolis to make way for his new robotic empire.\"},\n            MessageBox {message = \"Leon: Ivan was buried under the rubble of his family home. {p60}He only survived because his father had pushed him out of the way as their roof collapsed, sacrificing himself to save his son...\"},\n            Do(function()\n                self.scene.player.sprite:setAnimation(\"sadleft\")\n            end),\n            Ease(self.scene.objectLookup.IvanGhost.sprite.color, 4, 0, 1),\n            Ease(self.scene.camPos, \"x\", 0, 0.3),\n            MessageBox {message = \"Leon: So you see...{p80} though I've tried my best, and though these young officers are very competent in matters of war...{p80} they still carry the scars of their past.\"},\n            MessageBox {message = \"Leon: They need more than a commanding officer--{p60} they need a true leader and mentor. {p60}Someone who can help them heal.\"},\n            MessageBox {message = \"Leon: I hope you can succeed where I have failed them, Princess.\"},\n            Do(function()\n                GameState:addBackToParty(\"sonic\")\n                GameState:addBackToParty(\"antoine\")\n                self.scene.player.sprite:setAnimation(\"thinking\")\n                self.scene:changeScene{map=\"sallyshut\", fadeOutSpeed=0.1,fadeInSpeed=0.1,fadeOutMusic=true, nighttime=false, hint=\"night\"}\n            end)\n        }\n    end\nend",
